Witam

Mam do sprzedania Peugeot 207 1.4 HDI z 2008 roku. Po serwisie olejowym przy 295 tys. Km. i wszystkich filtrów. Rozrząd wymieniany 2 lata temu. Idealne auto na dojazdy do pracy. Jest bardzo oszczędne. Jego spalanie wynosi 4,5 l/100 km. Na pełnym zbiorniku można przejechać 1200 km. Długie opłaty: przegląd i OC do końca grudnia 2025. Pojazd jest dość dobrze wyposażony:



- światła halogenowe;



- elektryczne szyby;



- elektryczne podgrzewane luterka;



- klimatyzacja;



- komputer pokładowy;



- oryginalne radio CD + MP3 sterowanie w kierownicy; 



- 4 x airbag;



- ISOFIX;

i wiele innych o których możliwe, że nie napisałem.

Cena jaka mnie interesuje to 6900 zł. Jestem osobą prywatną, sprzedaż odbędzie się na umowę kupna-sprzedaży.



